pragma solidity 0.8.7;

contract C{
    event Log(address source,uint amount);
    function send(address payable dest1,address payable dest2) external payable{
        payable(dest1).transfer(msg.value/2);
        payable(dest2).transfer(msg.value/2);
        emit Log(msg.sender,msg.value);
    }
}



contract Sender{
    constructor() payable{}
    function getBalance() external view returns(uint){
        return address(this).balance;
    }
    function send(address c, address payable dest1,address dest2,uint amount) external{
        (bool success, bytes memory data) = c.delegatecall(abi.encodeWithSelector(C.send.selector,dest1,dest2));
    }
}


contract Receiver{
    receive() external payable{}
    function getBalance() external view returns(uint){
        return address(this).balance;
    }
}

